window.bookSummaryJSON = "<p>They raided my club. Destroyed everything I own. And stole the man I love.</p> <p>Now, it’s up to us to get him back.</p> <p>But we aren’t the only ones searching.</p> <p>From our old lives come new dangers. Knowing who to trust becomes a deadly game of cat and mouse, one that threatens everything I’ve built and everyone I love.</p> <p>Nash, War, and I won’t survive if Vincent doesn’t.</p> <p>In the midst of lies, secrets, and earth-shattering revelations, there’s only one thing we know for certain.</p> <p>This ends with violence.</p> <p><i>It Ends with Violence</i> is the third and final audiobook in the Saint View Psychos reverse harem, \"why choose\" trilogy. It cannot be listened to as a standalone.</p> <p>Listening order: <i>Start a War, Half the Battle, It Ends With Violence.</i></p> <p>This audiobook and series is a dark romance and contains scenes and elements that may be triggering for some listeners.</p>"; 
